def get_oa(parameters: int, levels: int):
    if levels == 2:
        if parameters <= 3:
            oa_func = _L4
        elif parameters <= 7:
            oa_func = _L8
        elif parameters <= 11:
            oa_func = _L12
        elif parameters <= 15:
            oa_func = _L16_2
        elif parameters <= 31:
            oa_func = _L32_2
        else:
            raise ValueError(f"No valid 2-level OA for {parameters} parameters.")
    elif levels == 3:
        if parameters <= 4:
            oa_func = _L9
        elif parameters <= 8:
            oa_func = _L18
        elif parameters <= 13:
            oa_func = _L27
        elif parameters <= 23:
            oa_func = _L36
        elif parameters <= 26:
            oa_func = _L54
        elif parameters <= 40:
            oa_func = _L81
        else:
            raise ValueError(f"No valid 3-level OA for {parameters} parameters.")
    elif levels == 4:
        if parameters <= 5:
            oa_func = _L16_4
        elif parameters <= 10:
            oa_func = _L32_4
        elif parameters <= 21:
            oa_func = _L64
        else:
            raise ValueError(f"No valid 4-level OA for {parameters} parameters.")
